function NotiText() {
  return (
    <div>
      <div class="pd-noti-float" className="max-h-16">
        <span class="noti-text">
          <img src="assets/img/icon/mini-noti-icon.svg" /> This product was last
          placed 2 minutes ago from Nonthaburi
        </span>
      </div>
    </div>
  );
}

export default NotiText;
